    "headlineNews": "Kirk Cousins completed 20-of-38 passes for 203 yards, one touchdown, and one interception in the Vikings' 14-7, Week 4 loss to the Browns.\n",
    "report": "",
    "analysis": "Cousins went a perfect 6-of-6 for 59 yards, including a 12-yard touchdown to Justin Jefferson, on the opening drive, but it was a nightmare the rest of the way. The Vikings went three-and-out on five of their next seven drives, and Cousins wasn't able to attempt any passes downfield with the Cleveland pass rush breathing down his neck. Cousins' interception in the fourth quarter was his first of the season. He entered Week 4 as the overall QB6 in fantasy but crashes way back down after this dreadful performance. Cousins will look to get back on track next week in a dream spot against the Lions.\n",
