    "headlineNews": "Justin Herbert completed 26-of-38 passes for 281 yards and four touchdowns in the Chargers' 30-24, Week 3 win over the Chiefs, adding four carries for 16 additional yards.\u00a0\n",
    "report": "",
    "analysis": "Herbert's 38 attempts were actually a season low, but he finally regressed to the touchdown mean with his four scores. His TD strikes went for four, 16, 20 and four yards, with the latter two going to a white-hot Mike Williams. The first four-yarder was an improvisational jump pass to Keenan Allen. Herbert continued to show ridiculous ball placement and appear like he is taking a step forward on his truly elite rookie campaign. There was a scary moment where Herbert jammed his throwing hand, but he literally shook it off and did not miss a play. The Raiders are a mouthwatering Week 4 matchup.\u00a0\n",
