    "headlineNews": "Drew Lock completed 12 of 21 passes for 113 yards and an interception in the Broncos' Week 4 loss to Baltimore.\u00a0\n",
    "report": "",
    "analysis": "Lock was his usual erratic self in one half of play against the Ravens. Forced into a pass-heavy game script, Lock had no chance against Baltimore's defense. He ended the game with a bad pick in the end zone on a ball intended for Courtland Sutton, and seemed generally out of sync with Sutton in their two quarters on the field together. Denver's offense is a fragile one that depends on a game manager like Bridgewater avoiding big mistakes and taking timely downfield shots to Sutton and Tim Patrick. With Lock under center, the Broncos would go from a playoff contender to a bottom dweller. Lock should only be considered in superflex formats next week against the Steelers.\u00a0\n",
