    "headlineNews": "Taylor Heinicke completed 23-of-33 passes for 290 yards and three touchdowns in Washington's Week 4 win against the Falcons, adding five rushes for 43 yards.\u00a0\n",
    "report": "",
    "analysis": "Playing his occasionally heart stopping brand of football,\u00a0Heinicke hit a few all-or-nothing passes against an awful Atlanta secondary, including a Hail Mary-type throw to Terry McLaurin in the fourth quarter.\u00a0Heinicke scrambled late in the ball game and threw across his body to J.D. McKissic, who broke a tackle and scored the go-ahead touchdown for Washington. Against a better secondary,\u00a0Heinicke could have thrown at least a couple interceptions on ill-advised throws into double and triple coverage. His aggressiveness and willingness to give McLaurin chances on downfield shots should make McLaurin an elite fantasy option for the remainder of the season.\u00a0Heinicke will be a decent QB2 option in Week 5 against New Orleans.\u00a0\n",
