    "headlineNews": "Lamar Jackson completed 22-of-37 attempts for 316 yards and a touchdown in the Ravens' Week 4 win against the Broncos, adding seven rushes for 28 yards.\u00a0\n",
    "report": "",
    "analysis": "Sunday marked the second time in Jackson's regular season career he's eclipsed 300 passing yards, and it could've been much more if not for a holding penalty that negated a 30-yard Mark Andrews touchdown grab. Between that called-back score and Marquise Brown's three dropped touchdowns in Week 4, Jackson's passing numbers should look far better than they do through the season's first month. Jackson played conservatively for much of the game against a vicious Denver defense that pressured L-Jax on nearly every drop back. The safe play paid off against a Broncos team that stood no chance of scoring after Teddy Bridgewater exited the contest with a brain injury. The Ravens get four home games in a row starting in Week 5 against the Colts. Jackson will again be an elite QB1 option.\u00a0\n",
