    "analysis": "The 400-yard game was the first of third-year pro Jones' career, and came despite Sterling Shepard and Darius Slayton sitting on the shelf with hamstring issues. Jones was buoyed by big-time YAC efforts from Saquon Barkley, Kadarius Toney and Kenny Golladay, who each drew at least six targets. Jones' \"interception\" was a first half Hail Mary. Jones was making big-time throws and giving his wideouts space to make plays. He has unquestionably appeared better this season while cutting down on his turnovers. A potential Week 5 shootout with the Cowboys looms as a massive test.\u00a0\n",
