    "logoUrl": "https://a.espncdn.com/i/teamlogos/nfl/500/jax.png",
    "headlineNews": "Trevor Lawrence completed 17-of-24 passes for 204 yards in the Jaguars' 24-21, Week 4 loss to the Bengals, adding eight carries for 36 additional yards and a touchdown.\u00a0\n",
    "report": "",
    "analysis": "Lawrence's night got off to an ominous start when D.J. Chark broke his ankle on the fourth play from scrimmage. That is going to be a major concern going forward, but Lawrence settled in this evening after some early inaccuracy caused primarily by late throws. Lawrence finally got his connection with Laviska Shenault going, finding the second-year pro for 6/99, including a 52-yard deep bomb for the normally YAC-focused wideout. What really kept the Bengals' defense off balance was Lawrence's rushing, with the rookie skillfully executing a number of read-option runs, including his seven-yard touchdown in the second quarter. The Jags are going to need a lot more of that going forward considering their personnel issues at wideout. Although tonight was easily Lawrence's best start as a pro, he will be a borderline top-18 option for next week's divisional date with the Titans.\u00a0\n",
