    "headlineNews": "Chris Carson rushed 13 times for 30 yards in the Seahawks' Week 4 win over the 49ers.\n",
    "report": "",
    "analysis": "Carson's inefficiency, while difficult to stomach, isn't even the major concern in this game. The looming threat is apparently Alex Collins, who saw 10 carries and a pair of targets. Carson only saw one target. On top of the forming committee in Seattle, Collins looked like the better runner, posting 44 yards and finding the end zone. It's not time to anoint Collins the starter but his volume will need to be monitored in Week 5, With Carson already seeing little usage as a receiver, he needs to dominate the carries in Seattle to maintain RB2 numbers. He stays in the top-20 running backs versus the Rams this week but is now a considerably riskier bet.\u00a0\n",
