    "headlineNews": "James Robinson rushed 18 times for 78 yards and two touchdowns in the Jaguars' Week 4 loss to the Bengals.\u00a0\n",
    "report": "",
    "analysis": "Even with\u00a0Carlos Hyde a surprise scratch with a shoulder issue, Robinson couldn't reach 20 carries for the first time in 2021, but his 18 totes were a new season high. He was doing yeoman's work, tacking on Capital T Tough yardage after first contact. That includes near the goal line, where he scored a six-yarder after a textbook plant-and-cut. He followed up with a four-yarder where he pile drove to the plane. Robinson was one of the main reasons the Jags almost snapped their 18-game losing streak. Regardless of Hyde's health, Robinson has taken back complete control of the Jags' backfield after coach Urban Meyer tried every other option first. He will be a locked-in RB2 for Week 5 vs. the Titans.\u00a0\n",
