    "headlineNews": "Jonathan Taylor rushed 16 times for 103 yards and a touchdown in the Colts' Week 4 win over the Dolphins.\n",
    "report": "",
    "analysis": "The Colts' offense put on a middling performance but Taylor had no problem breaking a handful of long runs versus the Dolphins. His highlight of the day was a 23-yard touchdown run in the first half. Taylor also caught all three of his targets for 11 yards. Marlon Mack earned a surprising 10 carries after being shopped on the trade market all week. Despite his boost in volume, Taylor backers shouldn't be concerned. He entered the game with a knee injury and the bulk of Mack's work came in the closing minutes of the game. Taylor remains an RB1 versus the Ravens next week.\u00a0\n",
