    "headlineNews": "Devin Singletary rushed 14 times for 79 yards, adding one reception for seven yards, in Buffalo's Week 4 win against the Texans.\n",
    "report": "",
    "analysis": "Singletary had a 41-yard run called back at the start of the third quarter on a holding penalty that didn't seem to impact the play, then fumbled just outside the red zone with 20 minutes left and was not unearthed again until a final drive that featured Mitch Trubisky. Weird game to read into. It's worth noting that Zack Moss was the first back on the field and that he had five red zone carries to Singletary's one. Singletary remains a RB3/FLEX play at best until his platoon with Moss resolves one way or another.\u00a0\n",
