    "analysis": "Williams stayed absolutely scorching in what was amazingly just the fifth 100-yard game of his five-year career. His scores went for 20 and four yards, with each giving the Chargers second half leads. They would not relinquish the second. For the 20-yarder, Williams separated from Mike Hughes and caught a bullet Justin Herbert had little time to unload. For the game-winner, Williams again got the better of Hughes. Sitting in the Chargers' highly-profitable \"X\" receiver spot, Williams is up to 22/295/4 through three games. That is WR1 production. The Raiders are a WR1 matchup for Week 4.\u00a0\u00a0\n",
