    "analysis": "The Eagles had no answer for Hill, allowing Patrick Mahomes to lock on to him the entire game.\u00a0He was Kansas City's entire pass offense, as none of the other Chiefs receivers finished with more than 25 yards. Hill's first two touchdowns came in the red-zone, and he was left wide open for a 44-yard TD to put the Eagles up two scores in the fourth quarter. This was a needed breakout for Hill after getting held under 60 yards the last two weeks. Hill gets another blowup spot in a Week 5 matchup against Buffalo on Sunday night.\n",
