    "analysis": "Lockett once again took a backseat to DK Metcalf, who led the team with eight targets. After blowing up for 278 yards and three touchdowns in his first two weeks, Lockett has cooled considerably over the past two. He has 55 yards in the previous two weeks combined. Seattle has played at a snail's pace this year and chose to lean on the run in this game, resulting in low receiving stats across the board. In games where their competition puts up a better fight, the Seattle pass-catchers should see far more targets on the whole. That projects to be the case next week as the Seahawks host the Rams on Thursday. Look for a rebound from Lockett if that game lives up to its shootout potential.\u00a0\n",
