    "headlineNews": "C.J. Uzomah caught 5-of-6 targets for 95 yards and two touchdowns in the Bengals' Week 4 win over the Jaguars.\u00a0\n",
    "report": "",
    "analysis": "With Tee Higgins missing another game with his shoulder issue, Uzomah stepped up as Joe Burrow's No. 3 passing-game weapon, posting the first two-score effort of his seven-year career and bettering his previous best yardage total by 29. Uzomah scored on plays of 22 and 31 yards, looking hard to take down in the open field on both occasions. For the first, he caught a perfectly-lofted ball from Burrow on a jailbreak screen. For the second, he got open on a scramble drill and rumbled down the field. The Bengals could certainly use more production from the seam, but tonight hardly seems likely to be the start of a TE2 trend for Uzomah. He does have a plus Week 5 matchup in a Packers defense surrendering the third most tight end fantasy points through three weeks.\u00a0\n",
